import {
  Box,
  Button,
  Card,
  Container,
  Grid,
  TextField,
  Typography,
} from "@mui/material";
import { useState } from "react";

const Contact = () => {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [phone, setPhone] = useState("");
  const [message, setMessage] = useState("");

  return (
    <Container sx={{ py: 6 }}>
      <Typography
        variant="h2"
        sx={{
          textAlign: "center",
          color: "#f99f00",
          mb: 4,
          fontWeight: "bold",
        }}
      >
        Contactanos
      </Typography>
      <Grid container gap={1} justifyContent="space-around">
        <Grid item xs={12} md={6}>
          <Card elevation={5} sx={{ minWidth: 120, p: 2 }}>
            <Box component="form">
              <Grid container>
                <Grid xs={12} md={12} sx={{ mb: 1 }}>
                  <TextField
                    fullWidth
                    label="Nombre"
                    value={name}
                    onChange={(event) => {
                      setName(event.target.value);
                    }}
                  />
                </Grid>
                <Grid xs={12} md={12} sx={{ mb: 1 }}>
                  <TextField
                    fullWidth
                    label="Correo electrÃ³nico"
                    value={email}
                    onChange={(event) => {
                      setEmail(event.target.value);
                    }}
                  />
                </Grid>
                <Grid xs={12} md={12} sx={{ mb: 1 }}>
                  <TextField
                    fullWidth
                    label="Telefono"
                    value={phone}
                    onChange={(event) => {
                      setPhone(event.target.value);
                    }}
                  />
                </Grid>
                <Grid xs={12} md={12} sx={{ mb: 1 }}>
                  <TextField
                    fullWidth
                    multiline
                    label="Dejanos un mensaje"
                    value={message}
                    onChange={(event) => {
                      setMessage(event.target.value);
                    }}
                    maxRows={4}
                  />
                </Grid>
                <Grid xs={12} md={12} sx={{ mb: 1 }}>
                  <Button variant="container" sx={{width:"100%", backgroundColor:"#f99f00", color:"#000032", fontSize:"20px"}}>Enviar</Button>
                </Grid>
              </Grid>
            </Box>
          </Card>
        </Grid>
      </Grid>
    </Container>
  );
};

export default Contact;
